import React, { useState } from 'react';
import { AppBar, Toolbar, Grid, Card, CardContent, CircularProgress } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import mockData from "./mockData";

const useStyles = makeStyles({
    listContainer: {
        paddingTop: '20px',
        paddingLeft: '50px',
        paddingRight: '50px'
    }
})

const getAnimalCard = (animalId) => {
    return(
    <Grid item xs={12} sm={4} key={animalId}>
        <Card>
            <CardContent>hello there</CardContent>
        </Card>
    </Grid>
    )
};

const AnimalList = () => {
    const classes = useStyles();
    const [animalData, setAnimalData] = useState(mockData);

    return (
        <>
        <AppBar position="static">
            <Toolbar />
        </AppBar>
        {animalData ? (
        <Grid container spacing={2} className={classes.listContainer}>
           {Object.keys(animalData).map(animalId =>
            getAnimalCard(animalId)
            )}
        </Grid>
        ) : (
            <CircularProgress />
        )}
        </>
    )
}

export default AnimalList;
